import  { useEffect, useRef, useState} from 'react'
import './contenidoContratistaAdmin.css'
import { Link } from "react-router-dom";
import axios from "axios";
import  env from "../../env.json";


const ContenidoContratistaAdmin = () => {
  /*const formRef = useRef();
  
  const [ contratista, setContratista ] = useState([]);
  const [ documento, setDocumento ] = useState([]);
  const [ zona, setZona ] = useState([]);
  const [ username , setUsername ] = useState('');
  const [ email , setEmail ] = useState('');
  const [ unRol, setUnRol ] = useState('');
  const [ unDocumento, setUnDocumento ] = useState('');
  const [ telefono, setTelefono ] = useState('');
  const [ nombres, setNombres ] = useState('');
  const [ apellidos, setApellidos ] = useState('');
  const [ fechaNacimiento, setFechaNacimiento ] = useState('');
  const [ unaZona, setUnaZona ] = useState('');
  const [ direccion, setDireccion ] = useState('');
  const [ barrio, setBarrio ] = useState('');
 
  const obtenerContratista= async () => {
    try {
      const response = await axios.get(`${env.host}/contratista`);	
      setContratista(response.data);
    } catch (err) {
      console.log(err);
    }
  };

  const obtenerTipoDocumento= async () => {
    try {
      const response = await axios.get(`${env.host}/tipoDocumento`);	
      setTipoDocumento(response.data);
      } catch (err) {
      console.log(err);
      }
    };

    const obtenerZona= async () => {
      try {
        const response = await axios.get(`${env.host}/zona/listar`);
        setZona(response.data);
        } catch (err) {
        console.log(err);
        }
      };

      const handleSubmit = async (e) => {
        e.preventDefault();
        try {
          const data = {
            unaZona: { 'idZona':unaZona },
            nombreZona,
            nit,
            represLegal,
            unDocumento: { 'idDocumento':unDocumento },
            fechaSuscripcion,
            fechaActaInicio,
            cantidadComplemtento,
            costoComplemento,
            cantidadAlmuerzo,
            costoAlmuerzo,
            totalCantiDiarias,
          
          };

          await axios.post(`${env.host}/contratista`, data);
          e.target.reset();
          alert("Contratista creado correctamente");
        } catch (e) {
          console.log(e);
          alert("Error al crear el contratista");
        }
      }

      useEffect(() => {
        (async () => {
          await obtenerContratista();
          await obtenerTipoDocumento();
          await obtenerMunicipio();
        } )();
      }, []);
*/
  return (
    <div id='contratista_div'>
      <div id='contratista_divruta'>
        <img id="contratista_iconos" src='/img/icono_inicio.png' alt='' />
        <Link id="contratisa_linkinicio" to="/InicioAdmin">Inicio/</Link>
        <img id="contratista_iconos" src='/img/icono_estudiantes.png' alt='' />
        <label id='contratista_textrutas'>Contratista/</label>
        <label id='contratista_textrutas'>Registro Contratista</label>
      </div>
      <form id="contratista_form" onSubmit={ handleSubmit} ref={formRef}>
        <div>
          <label>Nombre de usuario:</label>
          <input
            type="text"
            id="huella_inputs"
            className="form-control"
            placeholder="Usuario:*"
            //onChange= {e => setUsername(e.target.value)}
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="text"
            id="huella_inputs"
            className="form-control"
            placeholder="Email:*"
            //onChange= {e => setEmail(e.target.value)}
          />
        </div>
        <div>
          <label>Rol:*</label>
          <select
            className="form-select"
            aria-label='default select example'
            id="huella_inputs"
            //onChange={e => setRol(e.target.value)}
          >
            <option>Seleccione un rol</option>
             
          </select>      
        </div>
        <div>
          <label>Tipo Documento:</label>
          <select
            className="form-select"
            aria-label='default select example'
            id="huella_inputs"
            //onChange={e => setTipoDocumento(e.target.value)}
            >
            <option> Seleccione tipo documento </option>
            {tipoDocumento && tipoDocumento.map(tipoDocumentos =>
              <option key={tipoDocumentos.idTipoDocumento} value={tipoDocumentos.idTipoDocumento}>{tipoDocumentos.nombre}</option>
            )}
          </select>
        </div>
        <div>
          <label>Numero Documento:</label>
          <input
            type="number"
            id="huella_inputs"
            className="form-control"
            placeholder="Numero de documento:*"
            //onChange={e => setNumeroDocumento(e.target.value)}
          />
        </div>
        <div>
          <label>Telefono:</label>
          <input
            type="number"
            id="huella_inputs"
            className="form-control"
            placeholder="Telefono:*"
            //onChange={e => setTelefono(e.target.value)}
          />
        </div>
        <div>
          <label>Nombres:</label>
          <input
            type="text"
            id="huella_inputs"
            className="form-control" 
            placeholder="Nombres:*"
           // onChange={e => setNombres(e.target.value)}
          />
        </div>
        <div>
          <label>Apellidos:</label>
          <input
            type="text"
            id="huella_inputs"
            className="form-control"
            placeholder="Apellidos:*"
           // onChange={e => setApellidos(e.target.value)}
          />
        </div>
        <div>
          <label>Fecha Nacimiento:</label>
          <input
            type="text"
            id="huella_inputs"
            className="form-control"
            placeholder="Fecha Nacimiento:*"
           // onChange={e => setFechaNacimiento(e.target.value)}
          />
        </div>
        <div>
          <label>Lugar Nacimiento:*</label>
           <select
            className="form-select" 
            aria-label='default select example'
            id="huella_inputs"
           // onChange={e => setUnMunicipio(e.target.value)}
            >
            <option>Seleccione municipio</option>
            
            
          </select>
        </div>
        <div>
          <label>Dirección:</label>
          <input
            type="text"
            id="huella_inputs"
            className="form-control"
            placeholder="Dirección:*"
           // onChange={e => setDireccion(e.target.value)}
          />
        </div>
        <div>
          <label>Barrio:</label>
          <input
            type="text"
            id="huella_inputs"
            className="form-control"
            placeholder="Barrio:*"
            //onChange={e => setBarrio(e.target.value)}
          />
        </div>
        <div></div>
        <div></div>
        <div></div>
        <div>
          <button
            id="lim"
            type="button"
            class="btn btn-danger"
            //onClick={ () => formRef.current()}
          >Limpiar</button>
          <button 
            id="lim"
            type="submit"
            className="btn btn-primary btn-block">
              Guardar
            </button>
        </div>
      </form>
    </div>
  );
}

export default ContenidoContratistaAdmin;
